import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/recent" element={<RecentChecks />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="brand">PHISHING DETECTOR</Link>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/contact">Contact</Link>
          <Link to="/recent">Recent Checks</Link>
        </div>
      </div>
    </nav>
  );
}

function Home() {
  const [url, setUrl] = useState('http://[2a00:1450:4001:81c::200e]/signin');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const checkUrl = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // Replace with your actual backend API endpoint
      const response = await axios.post('http://localhost:5000/check', { url });

      if (response.data.error) {
        throw new Error(response.data.error);
      }

      setResult(response.data);

      // Save to recent checks in localStorage
      const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');
      const updatedRecent = [response.data, ...recent].slice(0, 10);
      localStorage.setItem('recentChecks', JSON.stringify(updatedRecent));

    } catch (err) {
      console.error("Error checking URL:", err);
      setError(err.message || 'Failed to check URL. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="home">
      <h1>Phishing URL Detection</h1>
      <div className="card">
        <form onSubmit={checkUrl}>
          <input
            type="url"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="Enter URL to check..."
            required
          />
          <button type="submit" disabled={loading}>
            {loading ? (
              <>
                <span className="spinner"></span> Checking...
              </>
            ) : (
              'Check URL'
            )}
          </button>
        </form>

        {error && <div className="error">{error}</div>}

        {result && (
          <div className="result">
            <h3>Analysis Result</h3>
            <p>URL: <a href={result.url} target="_blank" rel="noopener noreferrer">{result.url}</a></p>
            <div className={`status ${result.is_phishing ? 'phishing' : 'safe'}`}>
              {result.is_phishing ? '⚠️ PHISHING DETECTED' : '✅ SAFE WEBSITE'}
            </div>
            <div className="risk-level">
              <span>Risk Level:</span>
              <div className="progress-bar">
                <div 
                  className="progress" 
                  style={{ width: `${Math.round(result.probability * 100)}%` }}
                >
                  {Math.round(result.probability * 100)}%
                </div>
              </div>
            </div>
            <p className="timestamp">Checked on: {result.timestamp}</p>

            {result.is_phishing && (
              <div className="warning">
                <p>⚠️ Warning: This website appears to be a phishing attempt.</p>
                <p>Do not enter any personal or sensitive information.</p>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
}

function RecentChecks() {
  const [checks, setChecks] = useState([]);

  useEffect(() => {
    const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');
    setChecks(recent);
  }, []);

  const clearHistory = () => {
    localStorage.removeItem('recentChecks');
    setChecks([]);
  };

  return (
    <div className="recent">
      <h1>Recent Checks</h1>
      <div className="card">
        {checks.length > 0 ? (
          <>
            <button onClick={clearHistory} className="clear-btn">
              Clear History
            </button>
            <div className="table-container">
              <table>
                <thead>
                  <tr>
                    <th>URL</th>
                    <th>Status</th>
                    <th>Risk</th>
                    <th>Date</th>
                  </tr>
                </thead>
                <tbody>
                  {checks.map((check, index) => (
                    <tr key={index}>
                      <td>
                        <a href={check.url} target="_blank" rel="noopener noreferrer">
                          {check.url.length > 30 
                            ? `${check.url.substring(0, 30)}...` 
                            : check.url}
                        </a>
                      </td>
                      <td>
                        <span className={`tag ${check.is_phishing ? 'phishing' : 'safe'}`}>
                          {check.is_phishing ? 'Phishing' : 'Safe'}
                        </span>
                      </td>
                      <td>
                        <div className="progress-bar small">
                          <div 
                            className="progress" 
                            style={{ width: `${Math.round(check.probability * 100)}%` }}
                          >
                            {Math.round(check.probability * 100)}%
                          </div>
                        </div>
                      </td>
                      <td>{new Date(check.timestamp).toLocaleString()}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </>
        ) : (
          <p className="no-checks">No recent checks found.</p>
        )}
      </div>
    </div>
  );
}

// About and Contact components remain the same as previous example

export default App;
